import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import plantsData from '../data/plants.json';
import '../nature-theme.css';

type Plant = {
  id: number;
  name: string;
  scientificName: string;
  type: string;
  image: string;
  shortDescription: string;
};

const Home: React.FC = () => {
  const [plants, setPlants] = useState<Plant[]>([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [activeFilter, setActiveFilter] = useState('All');

  useEffect(() => {
    // Load plants data
    setPlants(plantsData);
  }, []);

  // Filter plants based on search term and type filter
  const filteredPlants = plants.filter((plant) => {
    // Filter by search term
    const matchesSearch = plant.name.toLowerCase().includes(searchTerm.toLowerCase()) || 
                          plant.scientificName.toLowerCase().includes(searchTerm.toLowerCase());
    
    // Filter by type (if filter is not set to 'All')
    const matchesType = activeFilter === 'All' || plant.type === activeFilter;
    
    return matchesSearch && matchesType;
  });

  const filterTypes = ['All', 'Tree', 'Medicinal', 'Flower'];

  return (
    <div className="container mx-auto px-4 pt-4 pb-20">
      <div className="mb-6 leaf-border">
        <h2 className="font-heading text-2xl text-forest-dark mb-4">Discover Plants</h2>
        
        {/* Search Bar */}
        <div className="mb-6 relative">
          <span className="absolute left-3 top-1/2 -translate-y-1/2 text-lg">üîç</span>
          <input
            type="text"
            placeholder="Search plants by name or scientific name..."
            className="search-input"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </div>
        
        {/* Filter Buttons */}
        <div className="flex flex-wrap gap-2 mb-2">
          {filterTypes.map((type) => (
            <button
              key={type}
              className={`filter-btn ${activeFilter === type ? 'active' : ''}`}
              onClick={() => setActiveFilter(type)}
            >
              {type === 'Tree' && 'üå≥ '}
              {type === 'Medicinal' && 'üåø '}
              {type === 'Flower' && 'üå∏ '}
              {type === 'All' && 'üçÉ '}
              {type}
            </button>
          ))}
        </div>
      </div>
      
      {/* Plants Grid */}
      {filteredPlants.length > 0 ? (
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-5">
          {filteredPlants.map((plant) => (
            <Link to={`/plant/${plant.id}`} key={plant.id} className="plant-card">
              <div className="aspect-square overflow-hidden relative">
                <div className="absolute inset-0 bg-gradient-to-b from-transparent to-black/30 z-10"></div>
                <img
                  src={plant.image}
                  alt={plant.name}
                  className="w-full h-full object-cover transition-transform hover:scale-110 duration-500"
                />
                <span className="absolute top-3 right-3 px-3 py-1 bg-leaf-dark/80 text-white rounded-full text-xs font-body z-20 backdrop-blur-sm shadow-md">
                  {plant.type === 'Tree' && 'üå≥ '}
                  {plant.type === 'Medicinal' && 'üåø '}
                  {plant.type === 'Flower' && 'üå∏ '}
                  {plant.type}
                </span>
              </div>
              <div className="p-4">
                <h2 className="font-heading text-xl text-primary leading-tight">{plant.name}</h2>
                <p className="text-xs font-serif text-earth-dark italic mb-2">{plant.scientificName}</p>
                <p className="text-sm font-body text-earth-dark line-clamp-2">{plant.shortDescription}</p>
              </div>
            </Link>
          ))}
        </div>
      ) : (
        <div className="leaf-corner text-center py-10">
          <span className="text-4xl block mb-4">üçÉ</span>
          <p className="text-earth-dark font-body mb-4">No plants found matching your criteria.</p>
          <button 
            onClick={() => { setSearchTerm(''); setActiveFilter('All'); }}
            className="nature-button"
          >
            Clear Filters
          </button>
        </div>
      )}
    </div>
  );
};

export default Home;
